// Generate parts consumed and returned table
function generatePartReturnedAndConsumedTable( param, defaultValue, isOnepmFSR=false) {
	let returnedEls = '';
	let issuedEls = '';
	let issuedCount = 0;
	let returnedCount = 0;
	let issueCount = 0;
	let returnCount = 0;
	if (param.material && param.material.length > 0) {
		//To restrict the number of parts to be displayed in the table for onepmFSR childs
		const materialArr = isOnepmFSR ? param.material.filter((element) => {
			if (element.part_activity.toLowerCase().includes("issued") && issueCount < 3) {
				issueCount++;
				return true;
			}
			if (element.part_activity.toLowerCase().includes("return") && returnCount < 3) {
				returnCount++;
				return true;
			}
			return false;
		}) : param.material;

		materialArr.forEach((element) => {
			if (element.part_activity.toLowerCase().includes('issued')) {
				issuedEls += `
				<div
							style="
								display: flex;
								flex-direction: row;
								border-bottom: 1px solid black;
								padding-left: 0.4rem;
								padding-right: 0.4rem;
								text-align: center;
								font-weight: 200;
							"
						>
							<div style="width: 5.33%; border-right: 1px solid black; text-align: center;">${++issuedCount}</div>
							<div style="width: 13.6%; border-right: 1px solid black; text-align: center; padding-left: 0.4rem; text-overflow: ellipsis; display: -webkit-box; -webkit-line-clamp: 1; -webkit-box-orient: vertical; overflow: hidden;">${element.part_code ? element.part_code : ""}</div>
							<div style="width: 49%; border-right: 1px solid black; text-align: center; padding-left: 0.4rem; text-overflow: ellipsis; display: -webkit-box; -webkit-line-clamp: 1; -webkit-box-orient: vertical; overflow: hidden;">${element.part_description ? element.part_description : ""}</div>
							<div style="width: 23.6%; border-right: 1px solid black; text-align: center; padding-left: 0.4rem; text-overflow: ellipsis; display: -webkit-box; -webkit-line-clamp: 1; -webkit-box-orient: vertical; overflow: hidden;">${element.part_serialno ? element.part_serialno : ""}</div>
							<div style="width: 8.33%; text-align: center; padding-left: 0.4rem;">${element.part_qty ? element.part_qty : ""}</div>
						</div>
				`;
			}

			if (element.part_activity.toLowerCase().includes('return')) {
				returnedEls += `
				<div
							style="
								display: flex;
								flex-direction: row;
								border-bottom: 1px solid black;
								padding-left: 0.4rem;
								padding-right: 0.4rem;
								text-align: center;
								font-weight: 200;
							"
						>
							<div style="width: 5.33%; border-right: 1px solid black; text-align: center;">${++returnedCount}</div>
							<div style="width: 13.6%; border-right: 1px solid black; text-align: center; padding-left: 0.4rem; text-overflow: ellipsis; display: -webkit-box; -webkit-line-clamp: 1; -webkit-box-orient: vertical; overflow: hidden;">${element.part_code ? element.part_code : ""}</div>
							<div style="width: 49%; border-right: 1px solid black; text-align: center; padding-left: 0.4rem; text-overflow: ellipsis; display: -webkit-box; -webkit-line-clamp: 1; -webkit-box-orient: vertical; overflow: hidden;">${element.part_description ? element.part_description : ""}</div>
							<div style="width: 23.6%; border-right: 1px solid black; text-align: center; padding-left: 0.4rem; text-overflow: ellipsis; display: -webkit-box; -webkit-line-clamp: 1; -webkit-box-orient: vertical; overflow: hidden;">${element.part_serialno ? element.part_serialno : ""}</div>
							<div style="width: 8.33%; text-align: center; padding-left: 0.4rem;">${element.part_qty ? element.part_qty : ""}</div>
						</div>
				`;
			}
		});
	}

	if (returnedCount < defaultValue || issuedCount < defaultValue) {
		for (let i = issuedCount; i < defaultValue; i++) {
			issuedEls += `
				<div
					style="
						display: flex;
						flex-direction: row;
						border-bottom: 1px solid black;
						padding-left: 0.4rem;
						padding-right: 0.4rem;
						text-align: center;
						font-weight: 200;
					"
				>
					<div style="width: 5.33%; border-right: 1px solid black; text-align: center;">${i+1}</div>
					<div style="width: 13.6%; border-right: 1px solid black; text-align: center; padding-left: 0.4rem;"></div>
					<div style="width: 49%; border-right: 1px solid black; text-align: center; padding-left: 0.4rem;"></div>
					<div style="width: 23.6%; border-right: 1px solid black; text-align: center; padding-left: 0.4rem;"></div>
					<div style="width: 8.33%; text-align: center; padding-left: 0.4rem;"></div>
				</div>
			`;
		}
	
		for (let i = returnedCount; i < defaultValue; i++) {
			returnedEls += `
				<div
					style="
						display: flex;
						flex-direction: row;
						border-bottom: 1px solid black;
						padding-left: 0.4rem;
						padding-right: 0.4rem;
						text-align: center;
						font-weight: 200;
					"
				>
					<div style="width: 5.33%; border-right: 1px solid black; text-align: center;">${i+1}</div>
					<div style="width: 13.6%; border-right: 1px solid black; text-align: center; padding-left: 0.4rem;"></div>
					<div style="width: 49%; border-right: 1px solid black; text-align: center; padding-left: 0.4rem;"></div>
					<div style="width: 23.6%; border-right: 1px solid black; text-align: center; padding-left: 0.4rem;"></div>
					<div style="width: 8.33%; text-align: center; padding-left: 0.4rem;"></div>
				</div>
			`;
		}
	}

	return { issuedEls, returnedEls }
}


// Generate safety assessment table
function generateSafetyTable(formdata) {
	const organizedData = {};

	let hazardsHTML = '<div style="text-align: left; width: 32%;" class="assessmentItem">';
	let risksHTML = '<div  style="text-align: center;" class="assessmentItem">';
	let canProceedHTML = '<div  style="text-align: center;" class="assessmentItem">';
	let measuresHTML = '<div  style="text-align: center;" class="assessmentItem">';

	// Organize the data by hazard and attribute
	if (formdata && formdata.length > 0) {
		formdata.forEach((item) => {
			for (const [key, value] of Object.entries(item)) {
				const keyParts = key.split(' - ');
				const category = keyParts[0];
				const attribute = keyParts[1];

				if (!organizedData[category]) {
					organizedData[category] = {};
				}

				organizedData[category][attribute] = value;
			}
		});

		for (const hazard in organizedData) {
			hazardsHTML += `${hazard} <br />`;
			risksHTML += `${organizedData[hazard]['Level of Risk'] || ''} <br />`;
			canProceedHTML += `${organizedData[hazard]['Can work proceed safely?'] || ''} <br />`;
			measuresHTML += `${organizedData[hazard]['Detail safety measures put in place?'] || ''} <br />`;
		}
	}

	hazardsHTML += '</div>';
	risksHTML += '</div>';
	canProceedHTML += '</div>';
	measuresHTML += '</div>';

	return `
		<div class="assessmentHeader">
			<div class="assessmentItem" style="text-align: center; font-weight: bold;width: 32%; font-size: 11.5px; font-family: TimesBold;">Hazard <br /></div>
			<div  class="assessmentItem" style="font-weight: bold; font-size: 11.5px; font-family: TimesBold;">Level of Risk <br /></div>
			<div class="assessmentItem" style="font-weight: bold; font-size: 11.5px; font-family: TimesBold;">Can work proceed safely? <br /></div>
			<div  class="assessmentItem" style="font-weight: bold; font-size: 11.5px; font-family: TimesBold;">Safety measures put in place? <br /></div>
		</div>
		<div style="display: flex; flex-direction: row; font-size: 10; font-family: Times;">
			${hazardsHTML}
			${risksHTML}
			${canProceedHTML}
			${measuresHTML}
		</div>
	`;
}


// Generate Thermal/Power Report
async function generateThermalOrPowerReport(page, finalObject) {
  const headerTemplate = 
		`<div style="display: flex; justify-content: space-between; align-items: center; width: 100%">
      <div style="font-size: 21px; font-family: TimesBold; margin-left: 30px; margin-top: 5px;">Field Service Report</div>
			<div style="display: flex; padding: 0.5rem; margin-right: 30px; margin-top: 10px;">
				<img
					height="30px"
					src="data:image/png;base64,"
				/>
			</div>
		</div>`
	const css = 
		`<style>
			@font-face {
				font-family: TimesBold;
				src: url(data:font/truetype;charset=utf-8;base64,);
			}
		</style>`

  await page.evaluate((finalObject) => {
    function setData(el, data) {
      const element = document.getElementById(el);
      if (element) element.textContent = data || '';
    }
    function setImage(el, data) {
			document.getElementById(el).src = data;
		}
    function setHTML(el, data) {
      const element = document.getElementById(el);
      if (element) element.innerHTML = data || '';
    }
    const engineerSignature =
			finalObject.param?.engineerSignature && finalObject.param.engineerSignature.length > 1
				? finalObject.param.engineerSignature
				: finalObject.room &&
					finalObject.room?.customFields &&
					finalObject.room?.customFields?.engineerSignature &&
					finalObject.room.customFields.engineerSignature.length > 1
					? finalObject.room.customFields.engineerSignature
					: '';

		const managerSignature =
			finalObject.param?.managerSignature && finalObject.param.managerSignature.length > 1
				? finalObject.param.managerSignature
				: finalObject.room &&
					finalObject.room?.customFields &&
					finalObject.room?.customFields?.managerSignature &&
					finalObject.room.customFields.managerSignature.length > 1
					? finalObject.room.customFields.managerSignature
					: '';

    // Basic customer and call information
    setData('customerName', finalObject.param.customer_name);
    setData('fsrNumber', finalObject.param.call_no);
    setData('fsrDateAndTime', finalObject.param.completion_date);
    setData('serviceType', finalObject.param.servicetype);
    
    // Customer address and contact information
    const customerAddress = [finalObject.param.customer_address1, finalObject.param.customer_address2, finalObject.param.customer_address3]
      .filter(addr => addr && addr.trim())
      .join(', ');
    setData('customerAddress', customerAddress);
    setData('contactPerson', finalObject.param.contact);
    setData('contactNumber', finalObject.param.contact_no);
    
    // Product information
    setData('productModel', finalObject.param.product_model);
    setData('productRating', finalObject.param.product_rating);
    setData('serialNumber', finalObject.param.product_serialno);
    setData('productCoverage', finalObject.param.product_coverage);
    
    // Engineer information
    setData('engineerName', finalObject.param.engineername);
    setData('engineerContactNumber', finalObject.param.call_engineer_mobilenumber);
    
    // Request and timing information
    setData('requestNumber', finalObject.param.id);
    setData('requestDateAndTime', finalObject.param.call_log_date);
    setData('assignedDateTime', finalObject.param.call_log_date);
    setData('scheduledDateTime', finalObject.param.call_log_date);
    setData('closedDateTime', finalObject.param.call_actual_end_date);
    
    // Problem statement and call details
    setData('problemStatement', finalObject.param.problemstatement);
    setData('callType', finalObject.param.call_type);
    setData('problemCode', finalObject.param.problem_code_description);
    setData('resolutionCode', finalObject.param.resolution_code_description);
    
    // Timing information
    setData('travelStartDateAndTime', finalObject.param.travel_start_time);
    setData('reportingDateAndTime', finalObject.param.reporting_date);
    setData('completionDateAndTime', finalObject.param.completion_date);
    setData('onSiteTime', finalObject.param.on_site_time);
    setData('travelTime', finalObject.param.travel_time);
    setData('numberOfVisits', finalObject.param.visits);
    setData('equipmentFace', finalObject.param.equipment_facetime_info);
    setData('breakTime', finalObject.param.break_time);
    setData('totalTimeSpent', finalObject.param.total_time);
    
    // Service billing
    setData('serviceBillable', finalObject.param.serviceBillable || 'Yes');

    let signatureHeader = `
					<div
						style="
							display: flex;
							flex-direction: column;
						"
					>
						<div style="width: 99%; text-align: justify; padding-left: 0.2rem; padding-right: 0.2rem; border-bottom: 1px solid black" class="times-bold">Customer's Comment</div>
						<div style="width: 99%; text-align: justify; padding-left: 0.2rem; padding-right: 0.2rem;  height: 4.5rem; font-weight: normal;">${finalObject?.paramObj?.ratings?.comment ? finalObject?.paramObj?.ratings?.comment : ''}</div>
					</div>
		`

		let signatureContent = `
			<div
				style="
					display: flex;
					flex-direction: row;
					text-align: center;
				"
			>
				<div style="width: ${managerSignature ? '33.33%' : '50%'}; flex-direction: column; height: inherit; display: flex; justify-content: space-between; text-align: center;">
					${finalObject.paramObj?.signature ? `<img src="${finalObject.paramObj?.signature}" id="customerSignatureAndSeal" class="full" />` : `<div class='full'></div>`}
					<div class="times-bold">Customer Signature</div>
				</div>
				<div style="width: ${managerSignature ? '33.33%' : '50%'}; flex-direction: column; height: inherit; display: flex; justify-content: space-between; text-align: center;  border-right: ${managerSignature ? '1px' : '0px'} solid black; border-left: 1px solid black;">
					${engineerSignature ? `<img src="${engineerSignature}" id="engineerSignatureAndSeal" class="full" />` : `<div class='full'></div>`}
					<div class="times-bold">Engineer Signature</div>
				</div>
				${managerSignature ?
				`<div style="width: 33.33%; flex-direction: column; height: inherit; display: flex; justify-content: space-between; text-align: center;">
						<img src="${managerSignature}" class="full" />
						<div class="times-bold">Signature of Manager</div>
					</div>`
				: ''
			}
			</div>
		`

		setHTML('signatureHeader', signatureHeader);
		setHTML('signatureContent', signatureContent);

    // Process workbench activities
    let obContent = '';
    let wdContent = '';
    let reContent = '';

    if (finalObject.param.workbench && Array.isArray(finalObject.param.workbench)) {
      finalObject.param.workbench.forEach(workbenchObj => {
        if (workbenchObj.activity_type_value?.toLowerCase().indexOf('observation') !== -1) {
          if (workbenchObj.activity_notes?.length > 0) {
            obContent = obContent.length > 0 ? `${obContent}\n` : obContent;
            obContent = `${obContent}[${workbenchObj.activity_date}] ${workbenchObj.activity_notes}`;
          }
        } else if (workbenchObj.activity_type_value?.toLowerCase().indexOf('recommendation') !== -1) {
          if (workbenchObj.activity_notes?.length > 0) {
            reContent = reContent.length > 0 ? `${reContent}\n` : reContent;
            reContent = `${reContent}[${workbenchObj.activity_date}] ${workbenchObj.activity_notes}`;
          }
        } else if (workbenchObj.activity_type_value?.toLowerCase().indexOf('work done') !== -1) {
          if (workbenchObj.activity_notes?.length > 0) {
            wdContent = wdContent.length > 0 ? `${wdContent}\n` : wdContent;
            wdContent = `${wdContent}[${workbenchObj.activity_date}] ${workbenchObj.activity_notes}`;
          }
        }
      });
    }

    // Set workbench content (these elements may not exist in template, but keeping for compatibility)
    setHTML('observation', obContent.replace(/\n/g, "<br><div style='height: 5px;'></div>"));
    setHTML('workDone', wdContent.replace(/\n/g, "<br><div style='height: 5px;'></div>"));
    setHTML('recommendation', reContent.replace(/\n/g, "<br><div style='height: 5px;'></div>"));
    
    // Set parts and assessment tables
    setHTML('partConsumed', finalObject.issuedEls);
    setHTML('partReturned', finalObject.returnedEls);
    setHTML('assessment', finalObject.tableHTML);
    
  }, finalObject);

  return await page.pdf({
    margin: { top: '5mm', right: '5mm', bottom: '5mm', left: '5mm' },
    format: 'A4',
    printBackground: true,
    displayHeaderFooter: true,
    headerTemplate: headerTemplate,
    footerTemplate: '<div style="font-size: 10px; font-family: TimesBold; text-align: right; margin-left: auto; padding-right: 30px; padding-bottom: 10px;">Page <span class="pageNumber"></span> of <span class="totalPages"></span></div>',
  });
}


