// Helper functions for DCPS
function generateBatteryDetails(batteryArray) {
	const batteryDetails = {};
	batteryArray.forEach((battery, index) => {
		batteryDetails[`battery${index + 1}Model`] = battery.model || '';
		batteryDetails[`battery${index + 1}Capacity`] = battery.capacity || '';
		batteryDetails[`battery${index + 1}Voltage`] = battery.voltage || '';
		batteryDetails[`battery${index + 1}Count`] = battery.count || '';
	});
	return batteryDetails;
}

function generateDCPSRiskAssesment(formdataArray) {
	const riskAssesment = {};
	formdataArray.forEach((form, index) => {
		if (form.risk_assessment) {
			Object.entries(form.risk_assessment).forEach(([key, value]) => {
				riskAssesment[`risk${index + 1}${key}`] = value || '';
			});
		}
	});
	return riskAssesment;
}

